import React, { useState } from 'react';
import './Chat.css';

const MoodMate = () => {
  const [activeTab, setActiveTab] = useState('chat');
  const [messages, setMessages] = useState([
    { id: 1, text: "Hello! I'm MoodMate. How can I help you today?", sender: 'bot' }
  ]);
  const [input, setInput] = useState('');
  const [isTyping, setIsTyping] = useState(false);

  const sendMessage = () => {
    if (!input.trim()) return;
    
    // Add user message
    setMessages(prev => [...prev, { id: Date.now(), text: input, sender: 'user' }]);
    setInput('');
    setIsTyping(true);
    
    // Simulate bot response
    setTimeout(() => {
      const responses = [
        "I understand how that might make you feel.",
        "Thank you for sharing that with me.",
        "Would you like to try a breathing exercise to help you relax?",
        "I'm here to listen whenever you need to talk.",
        "It's completely normal to feel that way sometimes."
      ];
      const randomResponse = responses[Math.floor(Math.random() * responses.length)];
      setMessages(prev => [...prev, { id: Date.now(), text: randomResponse, sender: 'bot' }]);
      setIsTyping(false);
    }, 1500);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      sendMessage();
    }
  };

  return (
    <div className="moodmate-app">
      {/* Header */}
      <div className="app-header">
        <div className="header-content">
          <div className="logo">
            <i className="fas fa-brain"></i>
            <h1>MoodMate</h1>
          </div>
          <div className="user-section">
            <div className="user-info">
              <span className="username">arm@200711</span>
              <div className="user-avatar">
                <i className="fas fa-user"></i>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="app-container">
        {/* Side Navigation */}
        <div className="side-nav">
          <div className="nav-items">
            <div 
              className={`nav-item ${activeTab === 'chat' ? 'active' : ''}`}
              onClick={() => setActiveTab('chat')}
            >
              <i className="fas fa-comment-dots"></i>
              <span>Chat</span>
            </div>
            <div 
              className={`nav-item ${activeTab === 'journal' ? 'active' : ''}`}
              onClick={() => setActiveTab('journal')}
            >
              <i className="fas fa-book"></i>
              <span>Journal</span>
            </div>
            <div 
              className={`nav-item ${activeTab === 'therapy' ? 'active' : ''}`}
              onClick={() => setActiveTab('therapy')}
            >
              <i className="fas fa-heart"></i>
              <span>Therapy</span>
            </div>
            <div 
              className={`nav-item ${activeTab === 'community' ? 'active' : ''}`}
              onClick={() => setActiveTab('community')}
            >
              <i className="fas fa-users"></i>
              <span>Community</span>
            </div>
            <div 
              className={`nav-item ${activeTab === 'shop' ? 'active' : ''}`}
              onClick={() => setActiveTab('shop')}
            >
              <i className="fas fa-shopping-bag"></i>
              <span>Shop</span>
            </div>
            <div 
              className={`nav-item ${activeTab === 'profile' ? 'active' : ''}`}
              onClick={() => setActiveTab('profile')}
            >
              <i className="fas fa-user-circle"></i>
              <span>Profile</span>
            </div>
          </div>

          <div className="premium-section">
            <div className="premium-card">
              <div className="premium-icon">
                <i className="fas fa-crown"></i>
              </div>
              <h3>Go Premium</h3>
              <p>Unlock advanced features and personalized guidance</p>
              <button className="premium-btn">Upgrade Now</button>
            </div>
          </div>
        </div>

        {/* Chat Area */}
        <div className="chat-area">
          <div className="chat-container">
            <div className="chat-messages">
              {messages.map((message) => (
                <div key={message.id} className={`message ${message.sender}`}>
                  <div className="message-content">
                    <p>{message.text}</p>
                  </div>
                  <div className="message-avatar">
                    {message.sender === 'bot' ? (
                      <i className="fas fa-robot"></i>
                    ) : (
                      <i className="fas fa-user"></i>
                    )}
                  </div>
                </div>
              ))}
              {isTyping && (
                <div className="message bot typing">
                  <div className="message-content">
                    <div className="typing-indicator">
                      <span></span>
                      <span></span>
                      <span></span>
                    </div>
                  </div>
                  <div className="message-avatar">
                    <i className="fas fa-robot"></i>
                  </div>
                </div>
              )}
            </div>

            <div className="chat-input-container">
              <div className="input-wrapper">
                <input
                  type="text"
                  value={input}
                  onChange={(e) => setInput(e.target.value)}
                  onKeyPress={handleKeyPress}
                  placeholder="Type your message here..."
                  className="message-input"
                />
                <button 
                  onClick={sendMessage} 
                  disabled={!input.trim()}
                  className="send-button"
                >
                  <i className="fas fa-paper-plane"></i>
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MoodMate;
